INSERT INTO `pager_data` VALUES (1,0,'<html>В версии 1.3.1 повилось рабочее место администратора зала.<br>Администратор зала это  сотрудниик, который помогает пришедшим посетителям выбрать услугу и ориентироваться в зале ожидания.<br>Основные возможности рабочего места оператора зала: поставить клиента в очередь, записать предварительно, следить за ходом очередей.',NULL,'2013-08-18 00:00:00',0),(2,0,'<html>Начиная с версии 1.3.1 на табло выводится видео в формате MP4<br>Надо понимать что расшитение файла *.mp4 не гарантирует применение именно этого кодека для сжатия контента внутри файла.<br>Если же у вас видео сжато другими кодеками, то это не проблема. Существует много бесплатных программ и сервисов для переконвертации.',NULL,'2013-08-19 00:00:00',0),(3,0,'<html>ПРЕДВАРИТЕЛЬНАЯ РЕГИСТРАЦИЯ В ОЧЕРЕДИ ЧЕРЕЗ ИНТЕРНЕТ<br>Вы можите предложить вашим клиентам воспользоваться данной возможностью удобно получить услугу предварительно записавшись через интернет.<br>Для этого нужно разместить кнопку или ссылку на сервис на вашем сайте, дать доступ сервису к серверу СУО.',NULL,'2013-08-19 00:00:00',0),(4,1,'<html>QSystem является свободным программым обеспечением и находится в свободном доступе.<br>На хостинге продукта на GoogleCode можно видеть количество скачиваний. Нам, как разработчикам, было бы полезно знать своих пользователей и их цели. Может это роботы качают.',NULL,'2013-08-19 00:00:00',0),(5,1,'<html>Светодиодные табло оператора. Не понятно хорошая это идея или пережиток прошлого.<br>Вы, как админы и те кто принимает решение о выборе СУО для своей организации, как считаете, это нужно? Стоит ли нам связываться со светодиодными табло не понятно. Вроде архаизм, но в тендорах до сих пор часто встречается.','','2013-08-19 00:00:00',0),(6,0,'<html>С НОВЫМ ГОДОМ ТОВАРИЩИ ПОЛЬЗОВАТЕЛИ!<br>Успешной вам работы и успехов в \"очередных\" делах.',NULL,'2013-12-23 00:00:00',0),(7,2,'<html>Решили составить небольшую карту использования QSystem.<br>Хотелось бы получить от пользователей немного информации о себе. Если не жалко.<br>Например: \"Челябинск банк купили\" или \"Воронеж ОООРомашка сами поставили\"','Пара слов о себе:','2013-12-23 00:00:00',0),(8,0,'<html>НА GoogleDisk доступна версия 1.3.6. Еще окончательно не вышла, но ставьте её!<br>QSystem1.3.6 уже стабильна и отлажена и в ней исправлена ошибка с главным табло.',NULL,'2014-04-19 00:00:00',0),(9,2,'<html>xREVOLUTION!!! Революционная идея в революционное время!<br>Название для проекта никто не придумывал. QSystem появилось само в процессе разработки.<br>Мы вот подумали, а может придумать бренд. Ваше мнение и предложение, Типа \"СУО Паровозик\"','А не назвать ли так:','2014-04-19 00:00:00',0),(10,0,'<html><font size=\"5\" color=\"red\" face=\"Arial\"><b>H E L P</b></font> to this project speak your native language. If you ready and can translate english or russian let us know about it.<br>Помогите локализовать проект на ваш родной язык. Если готовы, дайте знать по почте.<br><u><font color=\"blue\">email: evgeniy.egorov@gmail.com</font></u><a  href=\"mailto:evgeniy.egorov@gmail.com>1</a>',NULL,'2014-04-19 00:00:00',1),(11,0,'<html><font size=\"5\" color=\"green\" face=\"Arial\"><b> Dear users!</b></font> We have never received any information about experience of using QMS QSystem from non-speak-russian users. If we had some comments we would be able make QSystem better. Problems and advices would be so diverse in the world wide. Tell us about your experience. Language is not important, I hope google translate help us.<br><u><font color=\"blue\">email: evgeniy.egorov@gmail.com</font></u><a  href=\"mailto:evgeniy.egorov@gmail.com>1</a>',NULL,'2014-10-13 00:00:00',1),(12,0,'<html><font size=\"5\" color=\"green\" face=\"Arial\">Дамы и господа!</font><br>На форуме можно посмотреть фото объектов от самих пользователей.<br>Так же общесвенность была бы признательна за <b>ФОТО</b> с вашего объекта. Посмотреть и поделиться парой изображений вашего труда и историей <font color=\"blue\">ТУТ на форуме qsystem.info</font>. <a   href=\"http://qsystem.info/index.php/forum/2-%D0%9A%D0%BE%D0%BF%D0%B8%D0%BB%D0%BA%D0%B0/489-fotografii-realnykh-ob-ektov-ot-samikh-polzovatelej\">',NULL,'2014-10-15 00:00:00',1);
